import { Component } from '@angular/core';

@Component({
  selector: 'app-students',
  templateUrl: './students.component.html',
  styleUrls: ['./students.component.css']
})
export class StudentsComponent {
students:{name:string,age:number,email:string}[]=[
  {name:"Hossam",age:23,email:"hossammetwally@gmail.com"},
  {name:"ali",age:21,email:"ali@gmail.com"},
  {name:"mohamed",age:23,email:"mohamed@gmail.com"},
  {name:"ahmed",age:23,email:"ahmed@gmail.com"},
  {name:"mahmoud",age:23,email:"mahmoud@gmail.com"},
  {name:"koko",age:23,email:"koko@gmail.com"},
  {name:"dani",age:23,email:"dani@gmail.com"},
];
}
